import React from 'react';


import './AllReviews.css'
const AllReviews = () => {
 
const swiper = new Swiper('.swiper-container', {
	effect: 'coverflow',
	centeredSlides: true,
	slidesPerView: 1,
	loop: true,
	speed: 600,
	
 	autoplay: {
		delay: 3000,
 	},
	
	coverflowEffect: {
		rotate: 50,
		stretch: 0,
		depth: 100,
		modifier: 1,
		slideShadows: true,
	},
	
	breakpoints: {
		320: {
			slidesPerView: 2,
		},
		560: {
			slidesPerView: 3,
		},
		990: {
			slidesPerView: 4,
		}
	},

	pagination: {
		el: '.swiper-pagination',
		clickable: true,
	},

	navigation: {
		nextEl: '.swiper-button-next',
		prevEl: '.swiper-button-prev',
	},
});


    return (
        <div>
      <div class="swiper-container">
	<div class="swiper-wrapper">
		<div class="swiper-slide">a</div>
		<div class="swiper-slide">b</div>
		<div class="swiper-slide">c</div>
		<div class="swiper-slide">d</div>
		<div class="swiper-slide">e</div>
		<div class="swiper-slide">f</div>
		<div class="swiper-slide">g</div>
		<div class="swiper-slide">h</div>
		<div class="swiper-slide">i</div>
	</div>
	<div class="swiper-pagination">j</div>
	<div class="swiper-button-prev">k</div>
	<div class="swiper-button-next">l</div>
</div>
        </div>
    );
};

export default AllReviews;
